import React from 'react';
import './user/styles.css';

function Footer() {
  return (
    <footer className="footer">
      <p>© 2024 노바문화센터 | 연락처: 02-1234-5678 | 서울시 노원구</p>
    </footer>
  );
}

export default Footer;
